//for start date
DateTime startdateValue = Get<DateTime>("StartDate");
string startmonth = startdateValue.Month.ToString();
string startyear = startdateValue.Year.ToString();

//string resultString = $"{month}:{year}";
Set<string>("StartMonth", startmonth);
Set<string>("StartYear", startyear);

//start month -> int
int intstartmonth = Convert.ToInt32(startmonth);
Set<int>("IntStartMonth", intstartmonth);

return true;

//for end date
DateTime enddateValue = Get<DateTime>("EndDate");
string endmonth = enddateValue.Month.ToString();
string endyear = enddateValue.Year.ToString();
Set<string>("EndMonth", endmonth);
Set<string>("EndYear", endyear);


//end month -> int
int intendmonth = Convert.ToInt32(endmonth);
Set<int>("IntEndMonth", intendmonth);


return true;

//for expired date
DateTime expireddateValue = Get<DateTime>("ExpiredDate");
string expiredmonth = expireddateValue.Month.ToString();
string expiredyear = expireddateValue.Year.ToString();

//string resultString = $"{month}:{year}";
Set<string>("ExpiredMonth", expiredmonth);
Set<string>("ExpiredYear", expiredyear);

//expired month -> int
int intExpiredMonth = Convert.ToInt32(expiredmonth);
Set<int>("IntExpiredMonth", intExpiredMonth);


return true;
